Two weeks ago, I went to a face-to-face confession at my parish and for one of my penances, My pastor had told me with such gentleness, "Pray to the Blessed Mother that you may be an example of her for the world to see." And friends, let me tell ya, I was SPEECHLESS. Never in my life have I ever heard a more beautiful penance nor experienced such a beautiful connection to Jesus and Mary in confession before. It felt as if they were truly present with me in that room, sitting right next to me, holding my hand, and telling me in the most gently way, "Emily, be an example of me for the world to see." 

As I Ieft the confessional, I was still in complete awe and tears just filled my eyes. If there had been no one in the church, I probably would have cried out loud. My heart was full of so many emotions and love that I instantly prayed, "Thank you, Jesus. Thank you, Mary. Thank you for telling this to me!"

Every day since then, I have been reminded about that experience and pray this prayer every morning: "Jesus and Mary, help me to be an example of you today. Let them see you in me."

